import React from 'react';

class Header extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div>
      <h1 className="logo">Logo</h1>
      <div className="menu container container-fluid row">
        <a className="col" href="#">Home</a>
        <a className="col" href="#">Products</a>
        <a className="col" href="#">Company</a>
      </div>
      <button type="button" className="btn btn-primary">Contact</button>
    </div>
    );
  }
}

export { Header }
